import React from "react";


function Login(){
    return(
        <div className="center">
            <h1>Login</h1>
            <form >
                <div className="txt_field">
                    <input type="text" />
                    <label>Username</label>
                </div>
                <div className="txt_field">
                    <input type="password" />
                    <label>Password</label>
                </div>
            </form>

        </div>
    );
}

export default Login;
